import React from 'react';
import { View, StyleSheet,Text } from 'react-native';

const HeaderTop = () => {
    return (
        <View style={styles.top}>
            <Text>1</Text>
            <Text>2</Text>
            <Text>3</Text>
        </View>
    );
}

const styles = StyleSheet.create({
    top: {
        width: '100vw',
        // height: '20px',
        backgroundColor: "#000",
        padding:'20px',
        margin:'20px'
    }
})

export default HeaderTop;
